def detect_face(img):
    program_starts = time.time()
    x = np.array([img],dtype="float32")

    tflite_interpreter.set_tensor(input_details[0]['index'],x)

    tflite_interpreter.invoke()

    pred = tflite_interpreter.get_tensor(output_details[0]['index'])
    list_category = ["Anger","disgust","fear","Happiness","Neutral","Sadness","suprise"]
    now = time.time()
    print("Time:",now - program_starts)
    return list_category[np.argmax(pred[0])]

    
def mask_detect(image, rectangle = False):
    
    img = image.copy()
    (h,w) = img.shape[:2]
    boxes, facial5points = detector.detect_faces(img)
    arr_emotion = []
    for box in boxes:
        (startX,startY,endX,endY)=box[:4].astype('int')

        #ensure the bounding boxes fall within the dimensions of the frame
        (startX,startY)=(max(0,startX),max(0,startY))
        (endX,endY)=(min(w-1,endX), min(h-1,endY))

        #extract the face ROI, convert it from BGR to RGB channel, resize it to 224,224 and preprocess it
        face=img[startY:endY, startX:endX]
        
        face=cv2.resize(face,(48,48))
        try:
            face = cv2.cvtColor(face, cv2.COLOR_BGR2GRAY)
        except:
            print()
        try:
            zero = np.zeros((48,48,3))
            zero[:,:,0] = face
            zero[:,:,1] = face
            zero[:,:,2] = face
            label = detect_face(zero)
            arr_emotion.append(label) 
        except:
            label = detect_face(face)
            arr_emotion.append(label) 
        # cv2.imshow('frame',face)
        # (mask,withoutMask) = model.predict(face.reshape(1,224,224,3))[0]

        # #determine the class label and color we will use to draw the bounding box and text
        # label='Mask' if mask>withoutMask else 'No Mask'
        # color=(0,255,0) if label=='Mask' else (0,0,255)
        color=(0,255,0)
        #include the probability in the label
        # label="{}: {:.2f}%".format(label,max(mask,withoutMask)*100)
        
        #display the label and bounding boxes
        if(rectangle):
            cv2.putText(img,label,(startX,startY-10),cv2.FONT_HERSHEY_SIMPLEX,0.45,color,2)
            cv2.rectangle(img,(startX,startY),(endX,endY),color,2)
        
    return img, arr_emotion

def detect_face_base64(img_base64):
    
    header, data = img_base64.split(',', 1)
    image_data = base64.b64decode(data)
    np_array = np.frombuffer(image_data, np.uint8)
    image = cv2.imdecode(np_array, cv2.COLOR_BGR2GRAY)
    # image = cv2.imdecode(np_array, cv2.IMREAD_UNCHANGED)
    result = []
    face=cv2.resize(image,(48,48))
    try:
        zero = np.zeros((48,48,3))
        zero[:,:,0] = face
        zero[:,:,1] = face
        zero[:,:,2] = face
        im, result = mask_detect(zero)
    except:
        im, result = mask_detect(face)
        print(result)
    return result
    # cv2.imshow('image', face)
    # cv2.waitKey(0)


def detect_face_base64_mask(img_base64):
    _, data = img_base64.split(',', 1)
    image_data = base64.b64decode(data)
    np_array = np.frombuffer(image_data, np.uint8)
    image = cv2.imdecode(np_array, cv2.IMREAD_UNCHANGED)
    arr=[]
    frame, arr = mask_detect(image)
        
    print(arr)
